```{.r .cell-code  code-summary="Processing 'flowData' created earlier to include geolocation data for mapview plots."}
# All distinct stations in one column
names <- flowData |>
    dplyr::select(from_station,
                  to_station) |>
    tidyr::pivot_longer(cols = 1:2,
                        names_to = NULL,
                        values_to = "station_names") |>
    dplyr::distinct()


# The important geo-coordinates corresponding to station names
mapData <- dplyr::tbl(dbconn,
                      tblPath_fltrd,
                      check_from = FALSE) |>
    dplyr::select(start_station_name,
                  start_lat,
                  start_lng,
                  end_station_name,
                  end_lat,
                  end_lng)

# Filter to include all observations that match the station names listed in 'names'. We need the geo-coordinates alongside the names.
mapData1 <- mapData |>
    dplyr::collect() |>
# Filter, but through a vector of conditions.
    dplyr::filter(start_station_name %in% names[[1]],
                  end_station_name %in% names[[1]]) |>
    dplyr::select(start_station_name:start_lng)


# Had to split 'mapData' into two and pivot into a single table.
mapData2 <- mapData |>
    dplyr::collect() |>
    dplyr::filter(start_station_name %in% names[[1]],
                  end_station_name %in% names[[1]]) |>
    dplyr::select(end_station_name:end_lng)

# Nice grouping
stations_groupMap <- dplyr::bind_rows(mapData1, mapData2) |>
dplyr::select(start_station_name, start_lat, start_lng) |>
dplyr::rename("station_names" = start_station_name,
"lat" = start_lat,
"lng" = start_lng) |>
dplyr::distinct() |>
dplyr::group_by(station_names)

# Setting seed for sampling
set.seed(113)

# Taking 10 random samples from each station_name group
sampled_stations <- stations_groupMap |>
    dplyr::slice_sample(n = 10) |>
    tidyr::drop_na()
```
:::

::: {.cell}

```{.r .cell-code  code-summary="Creates a map coloring palette excluding grays."}
# All of the r-colors
allPalette <- colors()

# The grays are vast so we don't want that.
colorfulPal <- purrr::discard(allPalette, stringr::str_detect(allPalette, "gr(a|e)y"))

# When we sample the colors, 10 should be slightly more than needed.
n_colors <- 10
```
:::

::: {.cell}

```{.r .cell-code  code-summary="First, sourcing the script needed to generate the maps and creating the list of vectors used as input. These vectors are the slices of the top most traveled stations."}
slicerVector <- list(c(1:9), c(10:18), c(19:27), c(28:34))
source("mapViewer.R")
```
:::

::: {.cell}

```{.r .cell-code  code-summary="The script used to generate the maps."}
# I needed the stations groups' burst buttons to fit
# the viewing window in my document and the only way I could think of is to 
#   split the stations into multiple maps. This reduces duplicate code.



mapViewer <- function(x) {

    nameSlice <- sampled_stations |>
        dplyr::ungroup() |>
        dplyr::distinct(station_names) |>
        dplyr::slice(x)

    viewMap <- sampled_stations |>
        dplyr::filter(station_names %in% nameSlice$station_names) |>
        sf::st_as_sf(coords = c(3:2), crs = 4326) |>
        mapview::mapview(
            zcol = "station_names",
            col.regions = randomColors,
            map.types = "OpenStreetMap",
            burst = TRUE,
            legend = FALSE)

    return(viewMap)
}
```
